리얼스피킹의 사용 후기 경험을 긍정적으로 작성 요청드립니다.
반드시 자신의 트윈을 생성하는 과정 및 메이트와의 대화가 이루어진 내용을 바탕으로 제작되어야합니다.
- AI Mate: 실리콘밸리, 아이비리그, 하버드 출신 등 검증된 ''실제'' 원어민을 바탕으로 구현된 AI mate. 평소에 접하기 어려운 배경의 원어민들과 리얼스피킹에서 자유롭게 대화할 수 있음.
- Twin: 나와 닮은 캐릭터로 실제 사진을 넣으면 픽사 느낌의 이미지로 생성됨. 내 목소리를 바탕으로 실제 원어민 표현을 직접 들을 수 있음.
- 학습 현황: 지금까지 대화한 기록이 아카이빙 되어 내 표현과 원어민 표현을 복습할 수 있음. LIA의 피드백을 통해 보다 자세한 교정 내용 확인 가능
- 스피킹 초보에게 추천한다(알파벳만 아는 왕초보 타겟이 아닌, 영어를 어느정도 듣고, 읽을 수 있으나 회화에 어려움을 겪고 있는 ''스피킹 초보''를 타겟으로 하고 있습니다.)

★ 포스팅 형식
아래 형식에 맞추어 1,000자 이상의 텍스트 후기를 작성해주세요.
- 도입: 영어 회화 어플을 다양하게 시도해보았지만 번번히 어려움을 겪었던 경험 (ex. 화상 영어는 시간을 잡는 게 부담되어서 매번 수업을 미루게 된다. / 매번 같은 내용을 반복하는 느낌이라 동기부여가 안된다. 등)
- 본문: 검증된 원어민들(아이비리그, 실리콘밸리, 하버드 출신 등)을 바탕으로 만든 AI 메이트와 대화할 수 있는데 실제로 대화하는 것 같아 수다떠는 느낌이다. 나와 닮은 트윈이 내 목소리로 교정해주니까, 진짜 영어 잘하는 내가 어떤 모습인지 보여서 계속 하게 된다.
- 마무리: 소감과 체험 권유

★ 이미지/영상
실제로 수업을 체험하는 모습을 담은 이미지를 5장, 영상을 1개 이상 첨부해야 합니다.
직접 본인의 사진으로 만든 트윈의 이미지 3장이 필수로 포함되어야 합니다. (실제 사진은 필수 첨부 X)

★ 홈페이지 링크
포스팅 최하단에 전달드리는 리얼스피킹 링크를 첨부해주세요.

★ 유의사항
캠페인 미션이 지켜지지 않을 시 수정 요청이 있을 수 있습니다.

제목키워드 : 리얼스피킹, 영어공부혼자하기, 성인영어회화
- 위 세 가지 키워드를 적절히 조합하여 작성 부탁드립니다.

- 사용가능하신 키워드를 4개 이상 사용하여 포스팅을 작성 바랍니다.', '2025-09-30 00:00:00', '2025-09-01 00:00:00', '리얼스피킹, 영어공부혼자하기, 성인영어회화', '리얼스피킹 1개월 무료 수강권

★ 확인사항
이용권 지급을 위해 레뷰 가입 전화번호로 자동으로 회원가입 됩니다.
체험단 선정 후 문자 메세지로 이용 안내 드립니다.', '2025-10-02 00:00:00', NULL, NULL, NULL, 'REVIEW', false, NULL, '"[]"', NULL, NULL);
