- 원고 및 콘텐츠 등록 기간 미준수 시 제공 내역에 대한 비용이 청구될 수 있습니다.
- 선정 후 제공내역 및 배송지 변경은 불가합니다.
- 콘텐츠 작성 시 선정된 캠페인의 제품으로 단독 촬영해 주셔야 합니다.
- 업체 측 요청에 따라 선정 인플루언서 수가 변경될 수 있습니다.
- 콘텐츠 유지기간은 캠페인 결과 발표일 기준 6개월이며, 미유지 시 페널티가 부여됩니다.
- 생성형 AI로 작성된 콘텐츠와 이미지는 수정 요청 및 페널티가 부여될 수 있습니다.', '2025-08-21 00:00:00', '2025-08-20 00:00:00', '※ 해당 캠페인은 [ 릴스 2건의 콘텐츠를 등록]해야 하는 캠페인입니다. 제공 내역 내 안내사항을 필독 후 진행 바랍니다.
★ 릴스의 경우 30초 이상 필수입니다.


※ 아래 미션을 참고하여, 2개의 릴스 콘텐츠를 진행해주세요.
- 1차리뷰 (8/27~9/4)
- 2차리뷰 (9/5~9/9)


1. 콘텐츠 주제: [건식 족욕기 추천]을 중심으로 구성 부탁드립니다.
- 다양한 각도에서 촬영된 영상을 활용해 주세요.

2. 아래의 요소를 영상에 꼭 포함해서 센스 있게 제작 부탁드립니다.
1) 얼굴과 제품 사용 장면을 반드시 함께 촬영하여 넣어주세요.
- 언박싱 영상보다는 실제 착용 장면 위주로 구성해 주세요. (함께 제공되는 무릎담요를 사용한 모습 포함)
- 제품 사용 중 일상적인 장면이 들어가면 좋습니다.
- 사용 전후의 모습을 비교하는 비포&애프터 장면이 들어가면 더욱 좋습니다
2) 평소 발의 피로감이나 붓기, 차가움 등 발 관리의 어려움을 간단히 이야기한 후, 에버조이 건식 족욕기와 함께라면 도움이 된다는 내용을 자연스럽게 전달 부탁드립니다.
- 제품의 구체적인 장점과 사용 방법을 강조해 주세요.
- 본인이 느낀 실제 사용 후기와 제품의 핵심 포인트를 평소 본인의 콘텐츠 스타일에 맞게 자연스럽게 녹여주세요!
3) 강조할 주요 특징:
- 부모님 선물로 적극 추천
- 17만 대 이상 판매된 대세 제품 / 효자 아이템
- 물이 필요 없는 간편한 건식 방식
- 물 없이도 엄청 뜨끈뜨끈함
- 무릎담요를 활용한 무릎까지의 따뜻함
- 좌훈보조대를 장착하면 좌훈까지 가능한 다기능 제품
4) 주의 사항! (필수 확인)
- 해당 제품은 의료기기가 아닙니디.
- 혈액순환, 수족냉증 같은 의료 용어 사용은 금지이며, 대신 ''피가 잘 도는 느낌, 온몸의 따뜻한 순환, 차가운 발''과 같은 표현을 사용 부탁드립니다.
- 제품 사용으로 통증 해결 등의 의료기기 오인 표현은 불가하며, 대신 ''발과 하체가 가벼워졌다, 피로 관리에 도움이 됐다''와 같은 표현으로 사용 부탁드립니다.
5) 썸네일은 두 가지 중 하나를 택하여 제작해주세요.
- 에버조이 로고 또는 브랜드명이 명확하게 보이도록 구성
- 별도의 텍스트 노출 없이 제품 사용 장면이 돋보이도록 구성

3. 릴스 업로드 시, 공식 계정(@everjoygram)을 사람태그해 주세요.


※ 브랜디드 콘텐츠 광고 진행을 위해 아래 절차를 꼭 진행해주세요.
1. 인스타그램 또는 페이스북 프로필에서 [설정 및 개인정보] → [창작자] → [브랜디드 콘텐츠] → [파트너 승인 요청] 옵션을 활성화해 주세요. (태그 직접 승인)
2. 브랜디드 콘텐츠 도구 설정 페이지에서 [파트너 추가], ‘에버조이(@everjoygram)’ 계정을 검색하여 승인된 파트너로 등록해 주세요.
3. 그 외 DM 또는 알림을 통해 태그 요청이 올 경우 승인 부탁드립니다.
* 제작하신 콘텐츠는 ‘에버조이’의 공식 광고에 활용될 수 있습니다. 광고 활용 및 콘텐츠 2차 활용에 동의하시는 분만 신청 부탁드립니다. (체험단 신청 시 자동 동의로 간주됩니다.)
4. 릴스에 아래 공식 계정을 사람태그해주세요. @everjoygram', '2025-08-30 00:00:00', '2025-08-22 00:00:00', '#협찬 #에버조이 #EVERJOY #건식족욕기 #족욕기추천 #족욕기 #족욕 #건식족욕 #건식족욕기추천 #부모님선물 #풋케어 #발관리 #좌훈', '	[에버조이] 편백 건식 좌훈 족욕기 HINO-100 1대 (229,000원 상당)', '2025-08-31 00:00:00', NULL, NULL, NULL, 'FREE', false, NULL, '"\"#협찬 #에버조이 #EVERJOY #건식족욕기 #족욕기추천 #족욕기 #족욕 #건식족욕 #건식족욕기추천 #부모님선물 #풋케어 #발관리 #좌훈\""', NULL, NULL);
