INSERT INTO public.campaigns (id, "businessId", title, description, platform, budget, "targetFollowers", "startDate", "endDate", requirements, "imageUrl", "imageId", "headerImageUrl", "thumbnailImageUrl", "announcementDate", status, "isPaid", "reviewFeedback", "reviewedAt", "maxApplicants", "rewardAmount", "detailImages", "productImages", questions, "createdAt", "updatedAt", deliverables, "detailedRequirements", "platformFeeRate", location, "productIntro", "viewCount", translations, "additionalNotes", "applicationEndDate", "applicationStartDate", "campaignMission", "contentEndDate", "contentStartDate", keywords, "provisionDetails", "resultAnnouncementDate", category, "mainCategory", "deletedAt", "budgetType", "isPublished", "youtubeUrl", hashtags, platforms, "campaignType") VALUES ('cmehunriw0001dn9vb2yhrdrd', 'cmegrgle80003p27l61l7qdji', '[풀무원]2025년형 풀무원김치냉장고', '에너지효율 2등급, 풀무원이 만든 김치냉장고', 'NAVERBLOG', 200000, NULL, '2025-09-20 03:00:00', '2025-10-04 03:00:00', '[콘텐츠 미션 – 총 3건]
* 실제 체험 후, 포스팅 총 3건 제작 요청 드립니다.
* 첫리뷰는 가급적 최대한 빠르게 받자마자 올려주세요 !

1. (포스팅1) 제품이 설치된 인테리어 환경 위주의 이미지/영상 + 제품 소구포인트 설명

2. (포스팅2) 본 냉장고로 숙성시킨 김치를 활용한 식사, 식단 위주의 소개 + 제품 소구포인트 연계 설명

3. (포스팅3) 본 냉장고의 다목적 보관모드를 활용해 사용하는 모습 위주의 소개 + 제품 소구포인트 연계 설명 -> 술장고, 간식전용 냉장고, 냉동식품 전용 냉장고 등
★ 공정위 경제적 이해관계 표기 반드시 엄수 부탁드립니다.
1. 포스팅 최상단(레뷰 배너 바로 아래) [본 포스팅은 풀무원건강생활로부터 제품 협찬을 받아 작성하였습니다.] 문구 필수 기재

2. 글자 크기를 본문보다 크게 하거나 글자색을 본문과 달리하는 등 쉽게 인식할 수 있도록, 문구 내용 변경 없이 작성해 주세요.
* 식품 사용 시 가급적 풀무원 제품 사용 권장하며, 타 식품브랜드 제품 사용 시 최대한 로고 보이지 않도록 연출 부탁드립니다.

[ 제품 기본 정보 (**반드시 사용설명서를 참고하여 사용 후 리뷰 부탁드립니다**) ]
1) 가을이 오기 전 빠르게 준비하는 김장 필수품 (* 8월 14일 이후 출시 예정)

2) 199L 이하 소형 김치냉장고 중 가장 높은 등급인 에너지 소비 효율 2등급 김치냉장고
- 4등급(‘24년형 모델) 대비 전기세 연간 8천원 절감 가능 (4등급: 약 2.5만원, 2등급: 약 1.7만원)

3) 풀무원 기술원에서 개발한 숙성 알고리즘 탑재
- 김치 숙성에 중요 요소인 만니톨, Co2, 유산균 생성 관련해 김치 전문가가 설계한 숙성 알고리즘 도입
- 숙성 초기 5~6일 간 7~10도에서 만니톨, Co2, 유산균 활성화 -> 이후 약 10~15일간 -0.5~1도에서 숙성 상태를 보존, 유지
- 그 결과 만니톨 1.24 g 생성, Co2 44.4% 증가, 유산균 약 900% 증가
(* 풀무원 톡톡배추김치 100g 기준, 풀무원 기술원 테스트 결과치로 김치 종류 및 사용 환경에 따라 차이 있음을 반드시 기재)

4) 인버터 컴프레셔 적용
- 지속 운전하며 미세하게 속도를 조절하여, 정속형 대비 소음이 적고 온도 유지에 유리한 방식
- 김치 숙성에 중요 요소인 온도 유지에 유리한 방식, 김치맛을 결정하는 핵심 기술
- 여기에 각 칸마다 냉기 토출구 적용되어, 칸마다 온도 유지에 유리한 쿨링 시스템 도입
- 단순히 차가운 환경에서 보관하는 것이 아니라, 설계된 온도에 최대한 가깝게 보관될 수 있는 정온 시스템

5) 락앤락 김치 전용 밀폐용기 포함
- 실제 기술원 연구 개발 시에 사용된 락앤락 김치통 제품 증정 (판매 채널에 따라 제공 수량 차이 있음)
- 김치 약 3포기 보관 가능한 8L 용량 (배추에 따라 차이 있음)

6) 1대로 4가지 활용 가능
- 김치모드를 비롯해 냉장, 냉동, 주류 전용 보관모드 탑재
- 원하는 목적에 따라 모드를 바꾸어 활용 가능 (1가지 모드로 전체 변경, 칸 별 설정 불가능)

7) 감성적인 글라스 도어와 린넨베이지 컬러, 키친테리어를 완성하는 뉴트럴 톤의 세련된 디자인

8) 김치냉장고 전문 서비스 대행사와 협업 (위니아에이드)
- 30년 이상 김치냉장고를 전문적으로 취급했던 노하우로 설치, A/S 제공
