INSERT INTO public.campaigns (id, "businessId", title, description, platform, budget, "targetFollowers", "startDate", "endDate", requirements, "imageUrl", "imageId", "headerImageUrl", "thumbnailImageUrl", "announcementDate", status, "isPaid", "reviewFeedback", "reviewedAt", "maxApplicants", "rewardAmount", "detailImages", "productImages", questions, "createdAt", "updatedAt", deliverables, "detailedRequirements", "platformFeeRate", location, "productIntro", "viewCount", translations, "additionalNotes", "applicationEndDate", "applicationStartDate", "campaignMission", "contentEndDate", "contentStartDate", keywords, "provisionDetails", "resultAnnouncementDate", category, "mainCategory", "deletedAt", "budgetType", "isPublished", "youtubeUrl", hashtags, platforms, "campaignType") VALUES ('cmejct5eg0001v81jw92pa0z1', 'cmegrgle80003p27l61l7qdji', '[살림백서] 딥클린 고농축 캡슐세제', '살림백서 딥클린 트리플 캡슐세제 한 알로 세탁 관리!', 'NAVERBLOG', 150000, NULL, '2025-09-11 03:00:00', '2025-09-25 03:00:00', '	

키워드


링크 삽입


1000자 이상


15장 이상


동영상 첨부

※ 브랜드 명 입력 시, 오탈자 없도록 주의해주세요 ※
O : 살 림 백 서
X : 생활백서, 살림생활 등
※ 살림백서 (*브랜드 명) 외 다른 브랜드 명은 리뷰에 기재하지 말아주세요.

★★ 체험 제품은 재판매 금지로 적발 시 민/형사상의 책임이 발생할 수 있습니다 ★★

★ [필수] 제시된 제목 키워드 전체 + 본문 키워드 1개 이상을 이용해 제목을 구성해주세요.
★ X착한, 안심, 친환경X- 단어 사용 금지
*포스팅 서론 부분에 살림백서 딥클린 트리플 액션 고농축 캡슐세제는 세탁할 때 뭐하나 빠지는 점, 부족한 점 없이, 아주 스마트한 캡슐 세탁세제라는 점 어필해주세요!

1. 매번 무거운 용기와 번거로운 세제 계량으로 빨래할 때 불편함이 있었는데, 살림백서 딥클린 트리플 액션 고농축 캡슐세제를 만나고 너무나도 쉽고 간편하게 세탁할 수 있다는 점 강조.
ㄴex, 손목에 부담되는 무거운 용기와 이별하고 살림백서 딥클린 트리플 액션 고농축 캡슐 하나만 세탁조에 톡! 쏙! 넣어서 간편하게 세탁해요~
ㄴex, 매번 세제 계량이 어렵다고 느껴졌는데 이제 그럴 걱정이 없어요~
ㄴex, 자취하는 딸 아들에게 사주었더니 쉽고 간편하게 혼자 세탁도 잘 하더라고요~ 등

2. 본인이 캡슐세제 사용하기 전 , 실제 세탁 시에 느꼈던 불편하고 번거로운 세탁 경험을 자세히 설명.
ㄴex, 날리는 가루 타입 세제와 묻히고 흘리기 쉬운 액체세제를 사용해 보니 왜 이제서야 캡슐세제로 정착했는지 알겠어요
ㄴex, 세탁뿐만 아니라 세탁기의 세척하기 번거로운 세제 투입구도 깔끔하게 관리할 수 있어요~ 등

3. 물에 빠르게 잘 녹는 수용성 필름으로 만들어져 세탁 후 잔여물 걱정 없이 깨끗한 세탁이 가능하다는 점 언급.
ㄴex, 캡슐세제를 사용하기 전까지만 해도 이 필름이 잘 녹아서 세탁이 잘 될까? 걱정했는데 물에 너무 빠르고 쉽게 녹아 깨끗하게 세탁이 가능해요 ~등

4. 생활 얼룩 제거에 뛰어난 9중 복합 효소 함유로 섬유 속 깊은 얼룩, 숨은 때까지 말끔하게 제거 가능하다는 점 언급.
ㄴex, 맨날 옷에 음식 흘리는 아이들로 인해 강력한 세정력을 원하는 편인데 숨은 때까지 확실히 제거 가능해요~등

5. 세탁 후에도 기분 좋게 지속되는 싱그러운 라벤더 향이 은은하게 난다는 점 언급.
ㄴex, 작지만 강한 고농축 캡슐세제가 향기까지 은은하고 자연스러워 세탁 후 잔향으로 하루 종일 기분이 상쾌해요~
ㄴex, 세탁 후 옷에서 기분 좋은 향기가 가득해요~ 몰랐는데 캡슐세제 향이 이렇게 좋나요~? 등

6. 피부첩포에 의한 일차자극테스트 완료와 CMIT/MIT 불검출 테스트 완료한 제품이라는 점 설명.
ㄴex, 피부에 닿는 섬유 세탁은 항상 중요하다고 생각하는데 이런 부분까지 신경 써준 제품인 것 같아요~ 등

7. 캡슐이 작지만 강한 세척력을 가진 제품이라 세정력이 아주 좋다는 점 어필.
ㄴex, 이 작은 캡슐 하나가 그렇게 세척을 잘할까? 싶었는데 세탁을 해보고 눈으로 직접 보니 강력한 세정력을 느낄 수 있었어요~ 등

8. 구매링크 URL을 삽입해주세요.
https://mkt.shopping.naver.com/link/684143649a061e3f9cefd4df

[촬영미션]
1. 제품을 직접 사용하는 사진을 포함하여 사진 총 15장 이상, 영상 1개 이상 필수로 첨부해주세요.
ㄴ 동일한 배경에서 촬영한 비슷한 구도의 이미지는 지양해주세요.
2. 세탁조에 캡슐세제를 투입하는 모습을 촬영해주세요.
3. 캡슐세제 위에 빨랫감을 넣는 모습을 촬영해주세요.
4. 캡슐세제 단독 컷(제품 잘 보이게) , 제품 제형 컷(캡슐세제) 촬영해주세요.
5. 캡슐세제와 관련있는 장소(ex, 세탁기 근처, 다용도실, 세탁기+캡슐세제 등) 관련 장소 비치 컷 넣어주세요.
6. 세탁 전, 후를 촬영해주세요.', 'https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755656617949_2nb2xqj9.png', NULL, 'https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755656526166_bvrl4nut.png', 'https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755656617949_2nb2xqj9.png', '2025-09-09 03:00:00', 'ACTIVE', true, NULL, NULL, 100, 0, NULL, '"[\"https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755656865831_idnrgyqz.jpg\"]"', '[{"id": "camera", "type": "select", "enabled": true, "options": ["휴대폰 카메라", "미러리스", "DSLR", "기타"], "question": "어떤 카메라를 사용하시나요?", "required": true}, {"id": "face_exposure", "type": "select", "enabled": true, "options": ["노출", "비노출"], "question": "포스팅 작성 시, 얼굴 노출이 가능한가요?", "required": true}, {"id": "job", "type": "text", "enabled": true, "question": "어떤 직업을 갖고 계시나요?", "required": true}, {"id": "address", "type": "address", "enabled": true, "question": "상품을 배송 받을 주소를 입력해 주세요.", "required": true, "useDefaultAddress": true}]', '2025-08-20 02:28:54.466', '2025-08-20 04:19:29.116', NULL, NULL, 0.2, '전국', NULL, 0, NULL, '📌 주의사항
