INSERT INTO public.campaign_templates (id, "businessId", name, description, data, "isDefault", "createdAt", "updatedAt") VALUES ('cmehaqddv0001336r3muco8xx', 'cmegrgle80003p27l61l7qdji', '홍삼', '홍삼', '"{\"title\":\"[트레서피] 녹용홍삼캡슐\",\"description\":\"쓴맛없이 먹기편한 녹용홍삼 영양제\",\"platform\":\"NAVERBLOG\",\"categoryId\":\"cmegss432000bkuzf3nfvsqad\",\"budgetType\":\"FREE\",\"budget\":0,\"startDate\":\"2025-08-22\",\"endDate\":\"2025-08-31\",\"applicationStartDate\":\"2025-08-19\",\"applicationEndDate\":\"2025-08-21\",\"announcementDate\":\"2025-08-22\",\"contentStartDate\":\"2025-08-22\",\"contentEndDate\":\"2025-08-30\",\"resultAnnouncementDate\":\"2025-08-31\",\"requirements\":\"[제품특징]\\n고급 원료 – 발효 녹용홍삼\\n뉴질랜드산 녹용, 6년근 홍삼을 발효해 흡수율·체내 이용률 극대화\\n▶지구력 증진에 도움을 주는 옥타코사놀 22mg 과 진세노사이드 함유\\n한약방 보약과 동일 급의 원료지만 발효 공정을 거쳐 더 탁월\\n\\n수능·학습 집중력 관리에 적합\\n체력·면역력 관리에 도움, 피로 회복 및 컨디션 유지\\n합리적인 가격\\n녹용 들어간 한약방 보약 한 재(1개월분) 가격: 50~60만원 이상\\n같은 금액이면 트레서피 4개월 이상 섭취 가능\\n\\n간편한 캡슐형(복용법 : 하루 4캡슐)\\n쓴맛·냄새 부담 없이 섭취 가능 → 청소년, 수험생, 아이들이 거부감 없이 잘먹음\\n▶ 일반한약과의 차별점 언급 > 데워서 먹어야하거나, 먹고나서 입 냄새가 나거나,\\n보관과 휴대가 불편하거나, 시간에 맞춰 복용해야하거나\\n믿을 수 있는 제조·품질 관리\\nGMP 인증, 엄격한 품질관리, 안전한 제조공정\\n휴대·보관 용이\\n외출·학원·시험장 등 어디서나 간편하게 챙김\\n\\n-발효 녹용홍삼 복합농축액: 흡수율이 일반 홍삼 대비 높음\\n-정제당·합성보존료 無첨가: 장기 섭취에도 부담 없음\\n-홍삼의 사포닌+녹용의 면역·회복 시너지\\n-캡슐 1정에 고농축 원료 함유 → 하루 권장량만으로도 충분한 영양 공급\\n\\n**필수 사진 컷:\\n제품 패키지+캡슐 근접샷\\n손 위에 캡슐 올린 크기 비교\\n자녀·수험생 등등 복용하는 사람이 섭취하는 장면\\n\\n제품 판매 링크를 삽입해주세요.\\nhttps://smartstore.naver.com/goscience21/products/6223758038\\n\\n- 캠페인 미션이 지켜지지 않을 시 수정 요청이 있을 수 있습니다.\\n\\n# 건강기능식품광고법의 규정에 벗어나는 표현이 있는 경우에는 수정 요청이 있을 수 있습니다.\\n- 효능 / 효과를 직접적으로 언급한 경우\\n- 제품 성분과 다른 내용을 기재한 경우\\n- 타 제품과 비교하는 경우\\n- 직접적인 병명이 노출된 경우\\n\\n\\n===================================\\n\\n※ \\\"성분에 대한 효능&효과\\\"가 자칫 \\\"제품자체가 가지는 효능&효과\\\"로 오인되지 않도록 작성시 각별히 유의 바랍니다.\\n※ 하기 식약처 사이버조사단 보도자료를 참고하여 리뷰 작성에 각별히 유의하시기 바랍니다.\\n▶ 자료링크 : https://c11.kr/lzz8\",\"hashtags\":\"트레서피,발효녹용홍삼,녹용홍삼캡슐,녹용홍삼영양제,녹용홍삼,홍삼녹용영양제,고농축녹용홍삼,홍삼보조제,수험생영양제,수능영양제,청소년홍삼,성장기홍삼,부모님홍삼선물,어른홍삼추천\",\"headerImageUrl\":\"https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755532447355_tvfvv5h9.jpg\",\"thumbnailImageUrl\":\"https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755532460162_0zhvruha.jpg\",\"youtubeUrl\":\"\",\"maxApplicants\":\"\",\"provisionDetails\":\"[트레서피] 녹용홍삼캡슐 60개 1박스\",\"campaignMission\":\"**필수 사진 컷:\\n제품 패키지+캡슐 근접샷\\n손 위에 캡슐 올린 크기 비교\\n자녀·수험생 등등 복용하는 사람이 섭취하는 장면\\n\\n제품 판매 링크를 삽입해주세요.\",\"keywords\":\"트레서피,발효녹용홍삼,녹용홍삼캡슐,녹용홍삼영양제,녹용홍삼,홍삼녹용영양제,고농축녹용홍삼,홍삼보조제,수험생영양제,수능영양제,청소년홍삼,성장기홍삼,부모님홍삼선물,어른홍삼추천\",\"additionalNotes\":\"\\t- 제공내역은 양도,판매,교환 불가하며, 적발 시 제품 정가·배송비 청구 및 페널티가 부여됩니다.\\n- 원고 및 콘텐츠 등록 기간 미준수 시 제공 내역에 대한 비용이 청구될 수 있습니다.\\n- 선정 후 제공내역 및 배송지 변경은 불가합니다.\\n- 콘텐츠 작성 시 선정된 캠페인의 제품으로 단독 촬영해 주셔야 합니다.\\n- 업체 측 요청에 따라 선정 인플루언서 수가 변경될 수 있습니다.\\n- 콘텐츠 유지기간은 캠페인 결과 발표일 기준 6개월이며, 미유지 시 페널티가 부여됩니다.\\n- 생성형 AI로 작성된 콘텐츠와 이미지는 수정 요쳥 및 페널티가 부여될 수 있습니다.\",\"productImages\":[\"https://i3otdokfzvapv5df.public.blob.vercel-storage.com/campaign/1755532477548_iwag4fs4.webp\"],\"dynamicQuestions\":[{\"id\":\"camera\",\"type\":\"select\",\"question\":\"어떤 카메라를 사용하시나요?\",\"options\":[\"휴대폰 카메라\",\"미러리스\",\"DSLR\",\"기타\"],\"required\":true,\"enabled\":true},{\"id\":\"face_exposure\",\"type\":\"select\",\"question\":\"포스팅 작성 시, 얼굴 노출이 가능한가요?\",\"options\":[\"노출\",\"비노출\"],\"required\":true,\"enabled\":true},{\"id\":\"job\",\"type\":\"text\",\"question\":\"어떤 직업을 갖고 계시나요?\",\"required\":true,\"enabled\":true},{\"id\":\"address\",\"type\":\"address\",\"question\":\"상품을 배송 받을 주소를 입력해 주세요.\",\"required\":true,\"useDefaultAddress\":true,\"enabled\":true}]}"', false, '2025-08-18 15:55:14.19', '2025-08-18 15:55:14.19');


