INSERT INTO public.language_packs (id, key, ko, en, category, description, "isEditable", "createdAt", "updatedAt", jp) VALUES ('cmeggm2kn00069baaeli6jt7y', 'admin.ui.dbConnected', '이 페이지는 데이터베이스와 완전히 연동되어 있습니다. 모든 변경사항이 실시간으로 저장되며, 자동 번역 기능이 포함되어 있습니다.', 'This page is fully integrated with the database. All changes are saved in real-time and include automatic translation.', 'admin', 'DB 연동 안내', true, '2025-08-18 01:52:05.255', '2025-08-18 01:52:05.255', 'このページはデータベースと完全に連動しています。すべての変更はリアルタイムで保存され、自動翻訳機能が含まれています。');
