INSERT INTO public.site_config (id, key, value, type, category, "updatedAt", "createdAt") VALUES ('cmehh93d0000598abn294b3c0', 'legal', '{"termsOfService":"서비스 이용약관\n제1조 (목적)\n본 약관은 회사가 제공하는 온라인 서비스의 이용조건 및 절차, 회사와 이용자의 권리·의무 및 책임사항을 규정함을 목적으로 합니다.\n제2조 (정의)\n\n\"서비스\"란 회사가 제공하는 모든 온라인 서비스를 의미합니다.\n\"이용자\"란 본 약관에 따라 서비스를 이용하는 회원 및 비회원을 의미합니다.\n\"회원\"이란 서비스에 개인정보를 제공하여 회원등록을 한 자를 의미합니다.\n\n제3조 (약관의 효력 및 변경)\n\n본 약관은 서비스 화면에 게시하여 공시합니다.\n회사는 필요시 관련 법령에 위배되지 않는 범위에서 본 약관을 변경할 수 있습니다.\n\n제4조 (서비스의 제공)\n\n회사는 연중무휴, 1일 24시간 서비스를 제공합니다.\n시스템 점검, 통신장애 등의 사유로 서비스 제공이 일시 중단될 수 있습니다.\n\n제5조 (개인정보보호)\n회사는 관련 법령에 따라 이용자의 개인정보를 보호하며, 개인정보 처리방침에 따라 개인정보를 처리합니다.\n제6조 (이용자의 의무)\n\n이용자는 서비스 이용 시 관련 법령과 본 약관을 준수해야 합니다.\n타인의 권리를 침해하거나 불법적인 행위를 해서는 안 됩니다.\n\n제7조 (서비스 이용제한)\n회사는 이용자가 본 약관을 위반할 경우 서비스 이용을 제한할 수 있습니다.\n제8조 (면책조항)\n회사는 천재지변, 불가항력적 사유로 인한 서비스 중단에 대해 책임을 지지 않습니다.","privacyPolicy":"개인정보처리방침\n제1조 (개인정보의 처리목적)\n회사는 다음의 목적을 위하여 개인정보를 처리합니다.\n\n회원 가입 및 관리: 회원 식별, 서비스 이용에 따른 본인확인\n서비스 제공: 콘텐츠 제공, 맞춤 서비스 제공, 본인인증\n고객 상담: 민원처리, 공지사항 전달, 분쟁조정 해결\n마케팅 및 광고: 신규 서비스 개발, 이벤트 및 광고성 정보 제공\n\n제2조 (처리하는 개인정보의 항목)\n필수항목\n\n이름, 아이디, 비밀번호, 이메일, 휴대전화번호\n서비스 이용기록, 접속로그, 쿠키, 접속IP정보\n\n선택항목\n\n생년월일, 성별, 주소, 관심분야\n\n제3조 (개인정보의 처리 및 보유기간)\n\n회원정보: 회원탈퇴 시까지 (단, 관련 법령에 따라 보존 필요시 해당 기간)\n서비스 이용기록: 3년\n접속로그: 3개월\n마케팅 정보: 동의철회 시까지\n\n제4조 (개인정보의 제3자 제공)\n회사는 이용자의 개인정보를 원칙적으로 외부에 제공하지 않습니다. 다만, 다음의 경우에는 예외로 합니다.\n\n이용자가 사전에 동의한 경우\n법령의 규정에 의거하거나, 수사목적으로 법령에 정해진 절차와 방법에 따라 요구가 있는 경우\n\n제5조 (개인정보처리의 위탁)\n회사는 서비스 향상을 위해 개인정보 처리업무를 외부에 위탁할 수 있으며, 위탁 시 관련 법령에 따라 안전하게 관리됩니다.\n제6조 (정보주체의 권리·의무 및 행사방법)\n이용자는 다음과 같은 권리를 행사할 수 있습니다.\n\n개인정보 처리현황 통지요구\n개인정보 열람요구\n개인정보 정정·삭제요구\n개인정보 처리정지요구\n\n권리행사 방법: 서면, 전화, 이메일을 통해 연락 시 지체없이 조치\n제7조 (개인정보의 파기)\n회사는 개인정보 보유기간 경과, 처리목적 달성 등으로 불필요하게 된 개인정보를 지체없이 파기합니다.\n\n전자적 파일: 복구 및 재생되지 않도록 안전하게 삭제\n기록물, 인쇄물: 분쇄하거나 소각하여 파기\n\n제8조 (개인정보의 안전성 확보조치)\n회사는 개인정보의 안전성 확보를 위해 다음과 같은 조치를 취하고 있습니다.\n\n관리적 조치: 내부관리계획 수립·시행, 정기적 직원 교육\n기술적 조치: 개인정보처리시스템 등의 접근권한 관리, 보안프로그램 설치 및 갱신\n물리적 조치: 전산실, 자료보관실 등의 접근통제\n\n제9조 (개인정보보호책임자)\n개인정보보호책임자\n\n성명: 홍길동\n직책: 개인정보보호담당자\n연락처: privacy@company.co.kr / 02-1234-5678\n\n제10조 (권익침해 구제방법)\n개인정보 침해신고센터: privacy.go.kr (국번없이 182)\n개인정보 분쟁조정위원회: kopico.go.kr (국번없이 1833-6972)\n대검찰청 사이버범죄수사단: spo.go.kr (국번없이 1301)\n경찰청 사이버안전국: cyberbureau.police.go.kr (국번없이 182)\n제11조 (개인정보처리방침의 변경)\n본 개인정보처리방침은 시행일로부터 적용되며, 법령 및 방침에 따른 변경내용의 추가, 삭제 및 정정이 있는 경우에는 변경사항의 시행 7일 전부터 공지사항을 통하여 고지할 것입니다.\n시행일자: 2024년 1월 1일","termsLastUpdated":"2025-08-19","privacyLastUpdated":"2025-08-19"}', 'string', NULL, '2025-08-20 03:05:35.715', '2025-08-18 18:57:45.541');
